import React from 'react';
import CardList from './CardList';
import { kanji } from './kanji';
import SearchBox from './SearchBox';

const App = () => {
  return(
    <div className='tc'>
      <h1>Hello Welcome to Michael's Shit Kanji Dictionary</h1>
      <SearchBox />
      <CardList kanji={kanji}/>
    </div>
  );
}

export default App;
